import React, { Component } from "react";
import LoginSignUp_UI from "./LoginSignUp_UI";

class LoginSignUp extends Component {
  constructor(props) {
    super();
    this.state = props;
    this.handleLogin = this.handleLogin.bind(this)
  }

  handleLogin(e) {
    console.log(e)
  }
  render() {
    return (
      <LoginSignUp_UI 
        data={this.state}
        handleLogin
      />
    )
  }
}
export default LoginSignUp;
